INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (106001, 1, "2030/12/17 14:59:59", 7, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", -363.0, "キャル", 0.0, 0, 7001);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105901, 1, "2030/12/17 14:59:59", 7, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", -363.0, "コッコロ", 0.0, 0, 7002);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105801, 1, "2030/12/17 14:59:59", 7, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", -363.0, "ペコリーヌ", 0.0, 0, 7003);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105801, 1, "2030/12/17 14:59:59", 10, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", -363.0, "ペコリーヌ", 0.0, 0, 10001);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (106001, 1, "2030/12/17 14:59:59", 10, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", -363.0, "キャル", 0.0, 0, 10002);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105901, 1, "2030/12/17 14:59:59", 10, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", -363.0, "コッコロ", 0.0, 0, 10003);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (106401, 2, "2030/12/17 14:59:59", 10, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", -363.0, "シェフィ", 0.0, 2104010, 10004);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105801, 1, "2030/12/17 14:59:59", 12, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", -416.5, "ペコリーヌ", 0.0, 0, 12001);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (106001, 1, "2030/12/17 14:59:59", 13, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", -363.0, "キャル", 0.0, 0, 13001);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105901, 1, "2030/12/17 14:59:59", 13, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", -363.0, "コッコロ", 0.0, 0, 13002);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (106401, 2, "2030/12/17 14:59:59", 13, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", -363.0, "シェフィ", 0.0, 2104010, 13003);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105801, 1, "2030/12/17 14:59:59", 13, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", -363.0, "ペコリーヌ", 0.0, 0, 13004);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105901, 1, "2030/12/17 14:59:59", 14, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", -363.0, "コッコロ", 0.0, 0, 14001);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (106401, 2, "2030/12/17 14:59:59", 14, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", -363.0, "シェフィ", 0.0, 2104010, 14002);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105801, 1, "2030/12/17 14:59:59", 14, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", -363.0, "ペコリーヌ", 0.0, 0, 14003);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (106001, 1, "2030/12/17 14:59:59", 14, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", -363.0, "キャル", 0.0, 0, 14004);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105901, 1, "2030/12/17 14:59:59", 15, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", -470.0, "コッコロ", 0.0, 0, 15001);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (106401, 2, "2030/12/17 14:59:59", 16, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", -363.0, "シェフィ", 0.0, 2104010, 16001);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105801, 1, "2030/12/17 14:59:59", 16, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", -363.0, "ペコリーヌ", 0.0, 0, 16002);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (106001, 1, "2030/12/17 14:59:59", 16, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", -363.0, "キャル", 0.0, 0, 16003);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105901, 1, "2030/12/17 14:59:59", 16, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", -363.0, "コッコロ", 0.0, 0, 16004);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105901, 1, "2030/12/17 14:59:59", 17, 0, "2015/12/17 15:00:00", 0.0, 1, 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", -363.0, "コッコロ", 0.0, 0, 17002);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (106001, 1, "2030/12/17 14:59:59", 25, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", -363.0, "キャル", 0.0, 0, 17004);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105901, 1, "2030/12/17 14:59:59", 25, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", -363.0, "コッコロ", 0.0, 0, 17005);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (106401, 2, "2030/12/17 14:59:59", 25, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", -363.0, "シェフィ", 0.0, 2104010, 17006);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105801, 1, "2030/12/17 14:59:59", 25, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", -363.0, "ペコリーヌ", 0.0, 0, 17007);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (190801, 1, "2030/12/17 14:59:59", 18, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", -363.0, "カリン", 0.0, 0, 18001);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (190801, 1, "2030/12/17 14:59:59", 18, 0, "2015/12/17 15:00:00", 0.0, 1, 2, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", -363.0, "カリン", 0.0, 0, 18002);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (190801, 1, "2030/12/17 14:59:59", 19, 0, "2015/12/17 15:00:00", 0.0, 1, 3, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", -470.0, "カリン", 0.0, 0, 19001);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (190801, 1, "2030/12/17 14:59:59", 19, 0, "2015/12/17 15:00:00", 0.0, 1, 4, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", -470.0, "カリン", 0.0, 0, 19002);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (190801, 1, "2030/12/17 14:59:59", 20, 0, "2015/12/17 15:00:00", 0.0, 1, 5, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", -470.0, "カリン", 0.0, 0, 20001);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (190801, 1, "2030/12/17 14:59:59", 20, 0, "2015/12/17 15:00:00", 0.0, 1, 6, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", -470.0, "カリン", 0.0, 0, 20002);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (106001, 1, "2030/12/17 14:59:59", 21, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", -363.0, "キャル", 0.0, 0, 21001);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105901, 1, "2030/12/17 14:59:59", 21, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", -363.0, "コッコロ", 0.0, 0, 21002);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (106401, 2, "2030/12/17 14:59:59", 21, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", -363.0, "シェフィ", 0.0, 2104010, 21003);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (105801, 1, "2030/12/17 14:59:59", 21, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", -363.0, "ペコリーヌ", 0.0, 0, 21004);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (190801, 1, "2030/12/17 14:59:59", 22, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", -430.0, "カリン", 0.0, 0, 22001);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (190801, 1, "2030/12/17 14:59:59", 22, 0, "2015/12/17 15:00:00", 0.0, 1, 2, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", -430.0, "カリン", 0.0, 0, 22002);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (190801, 1, "2030/12/17 14:59:59", 23, 0, "2015/12/17 15:00:00", 0.0, 1, 3, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", -430.0, "カリン", 0.0, 0, 23001);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (190801, 1, "2030/12/17 14:59:59", 23, 0, "2015/12/17 15:00:00", 0.0, 1, 4, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", -430.0, "カリン", 0.0, 0, 23002);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109001, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 4.08, 2, 1, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", -385.0, "エリコ（バレンタイン）", 8.0, 0, 24001);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109001, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 5.0, 2, 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", -385.0, "エリコ（バレンタイン）", 8.0, 0, 24002);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109001, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 10.11, 2, 3, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", -385.0, "エリコ（バレンタイン）", 8.0, 0, 24003);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109001, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 4.0, 2, 4, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", -385.0, "エリコ（バレンタイン）", 8.0, 0, 24004);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109001, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 6.0, 2, 5, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", -385.0, "エリコ（バレンタイン）", 8.0, 0, 24005);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109002, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 0.0, 1, 6, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 0.0, "エリコ（バレンタイン）", 0.0, 0, 24006);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109002, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 0.0, 1, 7, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 0.0, "エリコ（バレンタイン）", 0.0, 0, 24007);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109002, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 0.0, 1, 8, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 0.0, "エリコ（バレンタイン）", 0.0, 0, 24008);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109002, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 0.0, 1, 9, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 0.0, "エリコ（バレンタイン）", 0.0, 0, 24009);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109002, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 0.0, 1, 10, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 0.0, "エリコ（バレンタイン）", 0.0, 0, 24010);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109101, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 2.12, 2, 1, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", -385.0, "シズル（バレンタイン）", 8.0, 0, 24011);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109101, 5, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 4.19, 2, 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", -385.0, "シズル（バレンタイン）", 8.0, 0, 24012);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109101, 2, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 2.3, 4, 3, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", -385.0, "シズル（バレンタイン）", 8.0, 0, 24013);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109102, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 0.0, 1, 4, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 0.0, "シズル（バレンタイン）", 0.0, 0, 24014);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109101, 5, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 5.23, 2, 5, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", -385.0, "シズル（バレンタイン）", 8.0, 0, 24015);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109102, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 0.0, 1, 6, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 0.0, "シズル（バレンタイン）", 0.0, 0, 24016);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109101, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 5.01, 2, 7, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", -385.0, "シズル（バレンタイン）", 8.0, 0, 24017);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109102, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 0.0, 1, 8, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 0.0, "シズル（バレンタイン）", 0.0, 0, 24018);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109102, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 0.0, 1, 9, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 0.0, "シズル（バレンタイン）", 0.0, 0, 24019);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (109102, 1, "2030/12/17 14:59:59", 24, 10011, "2019/01/31 12:00:00", 0.0, 1, 10, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 0.0, "シズル（バレンタイン）", 0.0, 0, 24020);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (106401, 2, "2030/12/17 14:59:59", 26, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", -363.0, "シェフィ", 0.0, 2104010, 26001);
