INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (106001, 1, "2030/12/17 14:59:59", 43, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", -363.0, "キャル", 0.0, 0, 43003);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (123001, 1, "2030/12/17 14:59:59", 44, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", -416.5, "アメス", 0.0, 0, 43004);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (123001, 1, "2030/12/17 14:59:59", 44, 0, "2015/12/17 15:00:00", 0.0, 1, 2, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", -416.5, "アメス", 0.0, 0, 43005);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (123001, 1, "2030/12/17 14:59:59", 45, 0, "2015/12/17 15:00:00", 5.79, 2, 3, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", -416.5, "アメス", 0.0, 0, 43006);
INSERT INTO `v1_58cc2f4fbda686b9354ea1bd2cfd9889e27c4a60e6673c6c52a2a7b32cdfbc1b` VALUES (123001, 1, "2030/12/17 14:59:59", 46, 0, "2015/12/17 15:00:00", 0.0, 1, 1, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", -371.5, "アメス", 0.0, 0, 46001);
